import React from "react";
import { NavLink } from "react-router-dom";
import './Nav.css'

const Nav = () => {
    return (
    <nav>
        <div>
            <NavLink to="/main.do">
            Main
            </NavLink>
        </div>
        <div>
            <NavLink to="/detail.do">
            Detail
            </NavLink>
        </div>
        <div>
            <NavLink to="/display.do">
            Display
            </NavLink>
        </div>
        <div>
            <NavLink to="/risk.do">
            Risk
            </NavLink>
        </div>
    </nav>
    );
};

export default Nav;
